import React from 'react';
import "./Hero.scss";

export default function Hero( {children, backgroundImage} ) {

  var background = {  
    backgroundImage: `url(${process.env.PUBLIC_URL + "/assets/images/" + backgroundImage})`,
  };

  return (
        <section className="hero" style={background}>
            {children}
        </section>
  );
}
